export const BASE_URL = 'https://auth.nomoreparties.co';

export const register = (password, email) => {

    return fetch(`${BASE_URL}+/signup`, {
      method: 'POST',
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify({
        "password": password,
        "email": email
      })
    })
    .then((res) => {
      return res.json()
    })
    .then((res) => {
      console.log(res)
    })
}
